  true,\n\t\"url\": null,\n\t\"notes\": \"Provides national level estimates on both
  noncapitalized and capitalized spending for information and communication technology
  (ICT) equipment and computer software by U.S. nonfarm businesses with employees
  for NAICS 2-digit and selected 3-digit industries.  The Bureau of Economic Analysis
  (BEA), Federal Reserve Board, Bureau of Labor Statistics and industry analysts use
  these data to evaluate future productivity and economic growth prospects.  In addition,
  the proposed survey provides improved source data significant to the BEA's investment
  component of gross domestic product, estimates of capital stock and capital flow,
  and permits the reconciliation of important differences between reported production
  and consumption of technology.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
